import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import './Home.css'


export class NavigateBar extends Component {
  render() {
    return (

      <div className='background'>
        <nav style={{margin}} className='align'>    
        <u >  
          <h3>Train Route Management</h3><br/>
          <div style={{display:'flex',flexDirection:'column',alignItems:'flex-start'}}>
          <li><NavLink to="/routes"><b> Route Details</b></NavLink></li><br/><br/>
          <li><NavLink to="/trains"><b>Train Details </b></NavLink></li><br/><br/>
          <li><NavLink to="/station"><b>Intermediate Stations </b></NavLink></li><br/><br/>
          <li><NavLink to="/timeschedule"><b>Train Schedule</b></NavLink></li><br/><br/>
          </div>
        </u>
        </nav>
      </div>
    )
  }
}

export default NavigateBar
